import React from "react";
import styled from "styled-components";
import { makeStyles } from "@material-ui/core/styles";
import { Avatar, Divider } from "@material-ui/core";
import userPhoto from "../../../public/static/sandy.jpeg";
import { Container, Text } from "../../styledComponents";

const useStyles = makeStyles((theme) => ({
  profile: {
    width: theme.spacing(6),
    height: theme.spacing(6),
    borderRadius: 0,
  },
}));

const SideWrapper = styled(Container)`
  display: flex;
  flex: 0.4;
  padding-left: 110px;
  padding-top: 50px;
  background-color: white;
  flex-direction: column;
`;
const ContentWrapper = styled(Container)`
  display: flex;
  flex: 0.6;
  padding-right: 110px;

  background-color: transparent;
`;
const SingleTenant = (props) => {
  const classes = useStyles();
  return (
    <Container flex={1} row customStyles={{ height: "100%", width: "100%" }}>
      <SideWrapper>
        <Container flex={false} color="transparent" middle center>
          <Avatar src={userP} className={classes.profile} />
        </Container>
      </SideWrapper>
      <ContentWrapper>
        <Text>Heuuuuuuu youu</Text>
      </ContentWrapper>
    </Container>
  );
};
export default SingleTenant;
